import React, { Component } from "react";

class AddProduct extends Component {
  render() {
    return (
      <div id="add-product-container">
        <form id="add-product-form" className="add-product-form">
          <div>
            <input type="text" />
          </div>
        </form>
      </div>
    );
  }
}

export default AddProduct;
